import React from 'react';
import styled from 'styled-components';

const Header = () => {
    return (
        <HeaderContainer>
        <div>
            <h1>header</h1>
        </div></HeaderContainer>
    );
}

export default Header;

const HeaderContainer=styled.div`

background-color: red;
`
